B.aEM=new A.u('The in Flutter 2.10.0 introduced Material 3 ColorScheme is used and fully supported. However, many components in Flutter 3.0.x do still not use the updated ColorScheme\'s new colors by default as specified in M3 guide.\n\nWhen you enable FlexColorScheme\'s component sub-themes you get a theme that is close to the Material 3 style by default. With the component sub-themes settings you can adjust it further, and e.g. change which ColorScheme color each component uses. This is a convenient way to select and use any ColorScheme based color, as the themed color for components included in FlexColorScheme\'s supported component theme customization capabilities.\n\nOnly some widgets in Flutter 3.0.x implement M3 correctly. If you disable FlexColorScheme and set "useMaterial3:true" with toggle below, you can see which components currently get the new M3 styling.\n\nIn Flutter SDK 3.0.x there are Material widget elevation issues if you set "useMaterial3:true". For example Dialogs, Drawers, BottomSheet, PopupMenu and most Material using widgets will not get any elevation when it is used. This is due to a change in the Material elevation behavior when M3 is used. For elevation in M3, Material needs to specify shadowColor, and optionally surfaceTintColor. For custom Material widgets you ca do this, but SDK widgets using Material that do not yet implement their own M3 behaviour, do not do so yet, and do not get any elevation, even if they should in M3 design as well.',null,null,null,null,null,null,null,null,null,null)
