B.aD6=new A.u("With component themes enabled you can select scheme color for the themed AppBar background color. Using AppBarStyle is convenient and does not require activating FlexColorScheme component themes, but this offers more choices. Selecting a color to override used AppBarStyle, set it back to default to use AppBarStyle again.",null,null,null,null,null,null,null,null,null,null)
