B.aF3=new A.u("Use input modifiers to change the effective colors that define the ColorScheme. The input color values show the color before input modifiers, surrounding color is the effective result. Seeded ColorSchemes also modify input colors, above you can see how.",null,null,null,null,null,null,null,null,null,null)
B.an3=new A.cG(null,B.aCV,B.aF3,null,!1,null,null,null,null,!0,null,!1,null,null,!1,null,null,null,null)
B.aDx=new A.u("Component themes",null,null,null,null,null,null,null,null,null,null)
B.aEy=new A.u("The opinionated component widget sub theming is ON by default in this app, but OFF by default in the API. When OFF, FlexColorScheme mostly only harmonize the colors and you can adjust a few common sub-theme properties, like AppBar, see docs to find out more.\n\nThe default sub-theming follows Material Design 3 guideline whit its own twists. It is partially still limited by Flutter Material 2 based theming designs. Most visible change is the corner radius on Widgets, that depends on Widget type, but also font sizes in the TextTheme.",null,null,null,null,null,null,null,null,null,null)
B.an4=new A.cG(null,B.aDx,B.aEy,null,!1,null,null,null,null,!0,null,!1,null,null,!1,null,null,null,null)
